import logo from '../images/logo.png'
export default function Header() {
  return (
    
      <div className="container mx-auto flex flex-col items-center">
        <img
          src={logo}
          alt="Forex and AI Logo"
          className="w-24 h-24 object-contain"
        />
        <h1 className="bg-clip-text text-transparent bg-gradient-to-r from-pink-500 to-violet-500">Forex & AI Investment</h1>
        <p className="bg-clip-text text-transparent bg-gradient-to-r from-green-500 to-amber-400 ">Unlock the power of AI in the Forex market</p>

      </div>

  );
}
